// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract SafraToken {
    uint256 private _tokenIdCounter = 1;
    
    enum TipoSafra { Milho, Soja, Trigo, Cafe, Algodao }
    
    enum StatusSafra { Plantada, Crescendo, Colhida, Entregue }
    
    struct Safra {
        uint256 id;
        address produtor;
        TipoSafra tipo;
        uint256 quantidade;
        uint256 valorEstimado;
        StatusSafra status;
        string localizacao;
        uint256 dataPlantio;
        uint256 dataColheitaPrevista;
        bool tokenizada;
        address proprietarioAtual;
    }
    
    mapping(uint256 => Safra) public safras;
    mapping(address => uint256[]) public safrasDoProdutor;
    mapping(address => uint256[]) public safrasDoProprietario;
    
    uint256[] public todosSafraTokens;
    
    event SafraTokenizada(
        uint256 indexed tokenId,
        address indexed produtor,
        TipoSafra tipo,
        uint256 quantidade,
        uint256 valorEstimado
    );
    
    event SafraTransferida(
        uint256 indexed tokenId,
        address indexed de,
        address indexed para
    );
    
    event StatusSafraAtualizado(
        uint256 indexed tokenId,
        StatusSafra novoStatus
    );
    
    modifier apenasProprietario(uint256 _tokenId) {
        require(safras[_tokenId].proprietarioAtual == msg.sender, "Nao e o proprietario");
        _;
    }
    
    modifier apenasProdutor(uint256 _tokenId) {
        require(safras[_tokenId].produtor == msg.sender, "Nao e o produtor");
        _;
    }
    
    function tokenizarSafra(
        TipoSafra _tipo,
        uint256 _quantidade,
        uint256 _valorEstimado,
        string memory _localizacao,
        uint256 _dataColheitaPrevista
    ) public returns (uint256) {
        
        uint256 novoTokenId = _tokenIdCounter;
        _tokenIdCounter++;
        
        safras[novoTokenId] = Safra({
            id: novoTokenId,
            produtor: msg.sender,
            tipo: _tipo,
            quantidade: _quantidade,
            valorEstimado: _valorEstimado,
            status: StatusSafra.Plantada,
            localizacao: _localizacao,
            dataPlantio: block.timestamp,
            dataColheitaPrevista: _dataColheitaPrevista,
            tokenizada: true,
            proprietarioAtual: msg.sender
        });
        
        safrasDoProdutor[msg.sender].push(novoTokenId);
        safrasDoProprietario[msg.sender].push(novoTokenId);
        todosSafraTokens.push(novoTokenId);
        
        emit SafraTokenizada(novoTokenId, msg.sender, _tipo, _quantidade, _valorEstimado);
        
        return novoTokenId;
    }
    
    function transferirPropriedade(uint256 _tokenId, address _novoProprietario) 
        public 
        apenasProprietario(_tokenId) 
    {
        address proprietarioAnterior = safras[_tokenId].proprietarioAtual;
        safras[_tokenId].proprietarioAtual = _novoProprietario;
        
        _removerDaLista(safrasDoProprietario[proprietarioAnterior], _tokenId);
        safrasDoProprietario[_novoProprietario].push(_tokenId);
        
        emit SafraTransferida(_tokenId, proprietarioAnterior, _novoProprietario);
    }
    
    function atualizarStatus(uint256 _tokenId, StatusSafra _novoStatus) 
        public 
        apenasProdutor(_tokenId) 
    {
        safras[_tokenId].status = _novoStatus;
        emit StatusSafraAtualizado(_tokenId, _novoStatus);
    }
    
    function obterSafra(uint256 _tokenId) public view returns (
        address produtor,
        TipoSafra tipo,
        uint256 quantidade,
        uint256 valorEstimado,
        StatusSafra status,
        string memory localizacao,
        uint256 dataPlantio,
        uint256 dataColheitaPrevista,
        address proprietarioAtual
    ) {
        Safra memory safra = safras[_tokenId];
        return (
            safra.produtor,
            safra.tipo,
            safra.quantidade,
            safra.valorEstimado,
            safra.status,
            safra.localizacao,
            safra.dataPlantio,
            safra.dataColheitaPrevista,
            safra.proprietarioAtual
        );
    }
    
    function getSafrasDoProdutor(address _produtor) public view returns (uint256[] memory) {
        return safrasDoProdutor[_produtor];
    }
    
    function safrasQuePosse(address _proprietario) public view returns (uint256[] memory) {
        return safrasDoProprietario[_proprietario];
    }
    
    function todasSafras() public view returns (uint256[] memory) {
        return todosSafraTokens;
    }
    
    function _removerDaLista(uint256[] storage _lista, uint256 _tokenId) private {
        for (uint256 i = 0; i < _lista.length; i++) {
            if (_lista[i] == _tokenId) {
                _lista[i] = _lista[_lista.length - 1];
                _lista.pop();
                break;
            }
        }
    }
    
    function obterEstatisticas() public view returns (
        uint256 totalSafrasTokenizadas,
        uint256 proximoTokenId
    ) {
        return (todosSafraTokens.length, _tokenIdCounter);
    }
}
